-- ----------------------------
-- Table structure for su_order_goods
-- ----------------------------
DROP TABLE IF EXISTS `su_order_goods`;
CREATE TABLE `su_order_goods` (
  `rec_id` int(8) NOT NULL AUTO_INCREMENT,
  `order_id` smallint(8) DEFAULT NULL,
  `goods_id` smallint(8) DEFAULT NULL,
  `goods_name` varchar(64) DEFAULT NULL,
  `goods_num` int(8) DEFAULT NULL,
  `goods_price` float(10,2) DEFAULT NULL,
  PRIMARY KEY (`rec_id`)
) ENGINE=MyISAM AUTO_INCREMENT=82 DEFAULT CHARSET=utf8;

-- ----------------------------
-- Records of su_order_goods
-- ----------------------------

-- ----------------------------
-- Table structure for su_order_info
-- ----------------------------
DROP TABLE IF EXISTS `su_order_info`;
CREATE TABLE `su_order_info` (
  `order_id` int(11) NOT NULL AUTO_INCREMENT,
  `order_sn` varchar(64) DEFAULT NULL,
  `user_id` int(11) DEFAULT NULL,
  `order_status` tinyint(1) DEFAULT '0',
  `shipping_status` tinyint(1) DEFAULT '0',
  `pay_status` tinyint(1) DEFAULT '0',
  `shop_prices` float(10,2) DEFAULT NULL,
  `consignee` varchar(60) DEFAULT NULL,
  `province` smallint(5) DEFAULT NULL,
  `city` smallint(5) DEFAULT NULL,
  `district` smallint(5) DEFAULT NULL,
  `address` smallint(5) DEFAULT NULL,
  `mobile` varchar(60) DEFAULT NULL,
  PRIMARY KEY (`order_id`)
) ENGINE=MyISAM AUTO_INCREMENT=85 DEFAULT CHARSET=utf8;

-- ----------------------------
-- Records of su_order_info
-- ----------------------------

-- ----------------------------
-- Table structure for su_picture
-- ----------------------------
DROP TABLE IF EXISTS `su_picture`;
CREATE TABLE `su_picture` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT COMMENT '主键id自增',
  `path` varchar(255) NOT NULL DEFAULT '' COMMENT '路径',
  `url` varchar(255) NOT NULL DEFAULT '' COMMENT '图片链接',
  `md5` char(32) NOT NULL DEFAULT '' COMMENT '文件md5',
  `sha1` char(40) NOT NULL DEFAULT '' COMMENT '文件 sha1编码',
  `status` tinyint(2) NOT NULL DEFAULT '0' COMMENT '状态',
  `create_time` timestamp NULL DEFAULT CURRENT_TIMESTAMP COMMENT '插入时间',
  `savename` varchar(255) DEFAULT NULL,
  `c_time` datetime DEFAULT NULL ON UPDATE CURRENT_TIMESTAMP,
  `ext` varchar(255) DEFAULT NULL,
  `name` varchar(255) DEFAULT NULL,
  `m_time` datetime DEFAULT NULL ON UPDATE CURRENT_TIMESTAMP,
  `owner` varchar(255) DEFAULT NULL,
  `savepath` varchar(255) DEFAULT NULL,
  `size` double DEFAULT NULL,
  `is_file` varchar(255) DEFAULT NULL,
  `is_execut` varchar(255) DEFAULT NULL,
  `is_readable` varchar(255) DEFAULT NULL,
  `is_writable` varchar(255) DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=24 DEFAULT CHARSET=utf8;

-- ----------------------------
-- Records of su_picture
-- ----------------------------

-- ----------------------------
-- Table structure for su_region
-- ----------------------------
DROP TABLE IF EXISTS `su_region`;
CREATE TABLE `su_region` (
  `id` int(11) unsigned NOT NULL AUTO_INCREMENT COMMENT '表id',
  `name` varchar(32) DEFAULT NULL COMMENT '地区名称',
  `level` tinyint(4) DEFAULT '0' COMMENT '地区等级 分省市县区',
  `parent_id` int(10) NOT NULL COMMENT '父id',
  `is_show` tinyint(1) DEFAULT '1' COMMENT '是否显示0不显示1显示',
  PRIMARY KEY (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=47501 DEFAULT CHARSET=utf8;

-- ----------------------------
-- Records of su_region
-- ----------------------------

-- ----------------------------
-- Table structure for su_rewrite
-- ----------------------------
DROP TABLE IF EXISTS `su_rewrite`;
CREATE TABLE `su_rewrite` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT COMMENT '主键id自增',
  `rule` varchar(255) NOT NULL DEFAULT '' COMMENT '规则',
  `url` varchar(255) NOT NULL DEFAULT '' COMMENT 'url',
  `create_time` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '创建时间',
  `update_time` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '更新时间',
  PRIMARY KEY (`id`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8 COMMENT='伪静态表';

-- ----------------------------
-- Records of su_rewrite
-- ----------------------------

-- ----------------------------
-- Table structure for su_seo_rule
-- ----------------------------
DROP TABLE IF EXISTS `su_seo_rule`;
CREATE TABLE `su_seo_rule` (
  `id` int(11) unsigned NOT NULL AUTO_INCREMENT COMMENT '唯一标识',
  `title` text NOT NULL COMMENT '规则标题',
  `app` varchar(40) DEFAULT NULL,
  `controller` varchar(40) DEFAULT NULL,
  `action` varchar(40) DEFAULT NULL,
  `status` tinyint(4) NOT NULL DEFAULT '1' COMMENT '状态',
  `seo_title` text NOT NULL COMMENT 'SEO标题',
  `seo_keywords` text NOT NULL COMMENT 'SEO关键词',
  `seo_description` text NOT NULL COMMENT 'SEO描述',
  `sort` int(11) NOT NULL DEFAULT '0' COMMENT '排序',
  PRIMARY KEY (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=4 DEFAULT CHARSET=utf8;

